import './App.css';
import BarraNavegacion from './BarraNavegacion';
import Contenedor from './Contenedor';

function App() {
  return (
    <div className="App">
      <BarraNavegacion/>
      <header className="App-header">
        <Contenedor/>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
         Me llamo pamela
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >     
        </a>

      </header>
    </div>
  );
}

export default App;
